  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  bathymetry and shaded-relief maps of the Offshore of Tomales Point map area, California.
  Raster data file is included in \"BathymetryHS_OffshoreTomalesPoint.zip,\" which
  is accessible from http://pubs.usgs.gov/ds/781/OffshoreTomalesPoint/data_catalog_OffshoreTomalesPoint.html.
  The bathymetry and shaded-relief maps of the Offshore of Tomales Point Map Area,
  California, were generated from bathymetry data collected by California State University,
  Monterey Bay (CSUMB), by Fugro Pelagos, and by the U.S. Geological Survey. Mapping
  was completed between 2004 and 2010, using a combination of 200-kHz and 400-kHz
  Reson 7125, and 244-kHz Reson 8101 multibeam echosounders, as well as 234-kHz and
  468-kHz SEA SWATHPlus phase-differencing sidescan sonars. These mapping missions
  combined to collect bathymetry from about the 10-m isobath to beyond the 3-nautical-mile
  limit of California's State Waters.\",\n\t\"license_title\": null,\n\t\"extras\":
